import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <>
    <ul>
        <li>Sum </li>
        <li>Subtraction </li>
        <li>Division </li>
        <li>Multiplication </li>
    </ul>
  </>,
  document.getElementById('root')
);
